import React from 'react';
import { Document, Page } from 'react-pdf';

function PDFViewer({ pdfFile, pageNumber, onLoadSuccess }) {
  return (
    <div>
      <Document
        file={pdfFile}
        onLoadSuccess={onLoadSuccess}
      >
        <Page pageNumber={pageNumber} />
      </Document>
    </div>
  );
}

export default PDFViewer;
